    def kadane(arr):
        max_ending_here = max_so_far = arr[0]
        for x in arr[1:]:
            max_ending_here = max(x, max_ending_here + x)
            max_so_far = max(max_so_far, max_ending_here)
        return max_so_far

    if k == 1:
        return kadane(arr)

    total_sum = sum(arr)
    if total_sum < 0:
        return kadane(arr * k)

