    decreasing = [0] * n

    for i in range(n):
        increasing[i] = arr[i]
        for j in range(i):
            if arr[i] > arr[j]:
                increasing[i] = max(increasing[i], increasing[j] + arr[i])

    for i in range(n-1, -1, -1):
        decreasing[i] = arr[i]
        for j in range(i+1, n):
            if arr[i] > arr[j]:
