def comb_sort(arr):
    n = len(arr)
    gap = n
    shrink = 0.8
    sorted = False

    while not sorted:
        gap = int(gap * shrink)
        if gap <= 1:
            gap = 1
            sorted = True

        for i in range(0, n - gap):
            if arr[i] > arr[i + gap]:
                arr[i], arr[i + gap] = arr[i + gap], arr[i]
                sorted = False

    return arr

