def extract_quotation(s):
    result = []
    in_quotes = False
    current = []
    for char in s:
        if char == '"':
            if in_quotes:
                result.append(''.join(current))
                current = []
            in_quotes = not in_quotes
        elif in_quotes:
            current.append(char)
    return result

